// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

contract SmartFidget {
    address public immutable owner;
    uint256 public recordsCount;
    Record[] public records;

    struct Session {
        uint16 avg;
        uint16 min;
        uint16 max;
        uint16 id;
        uint256 duration;
        string main;
        string startTime;
        string endTime;
        string tags;
        string comment;
    }

    struct Record {
        address writer;
        uint16 avg;
        uint16 min;
        uint16 max;
        uint16 sessionCount;
        string main;
        uint256 totDuration;
        string date;
    }

    event RecordAdded(uint256 recordId);
    event SessionAdded(string date, uint256 sessionId);

    mapping(string => Session[]) public dayToSessions;
    mapping(address => bool) public permitted;

    constructor() {
        owner = msg.sender;
        permitted[owner] = true;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can do this!");
        _;
    }

    modifier onlyPermitted() {
        require(permitted[msg.sender] == true, "Unauthorized!");
        _;
    }

    function addPermitted() public onlyOwner {
        permitted[msg.sender] = true;
    }

    function addRecord(
        uint16 _avg,
        uint16 _min,
        uint16 _max,
        uint16 _sessionCount,
        uint256 _totDuration,
        string memory _main,
        string memory _date
    ) public onlyPermitted {
        Record storage newRecord = records.push(); // Create a new Record and get a reference to it.
        newRecord.writer = msg.sender;
        newRecord.avg = _avg;
        newRecord.min = _min;
        newRecord.max = _max;
        newRecord.sessionCount = _sessionCount;
        newRecord.totDuration = _totDuration;
        newRecord.main = _main;
        newRecord.date = _date;

        recordsCount++;
        emit RecordAdded(records.length - 1);
    }

    function addSession(
        uint16 _avg,
        uint16 _min,
        uint16 _max,
        uint16 _id,
        uint256 _duration,
        string memory _main,
        string memory _date,
        string memory _startTime,
        string memory _endTime,
        string memory _tags,
        string memory _comment
    ) public onlyPermitted {
        Session memory newSession = Session({
            avg: _avg,
            min: _min,
            max: _max,
            id: _id,
            duration: _duration,
            main: _main,
            startTime: _startTime,
            endTime: _endTime,
            tags: _tags,
            comment: _comment
        });
        dayToSessions[_date].push(newSession);
        emit SessionAdded(_date, _id);
    }

    function getRecordsCount() public view returns (uint256) {
        return records.length;
    }

    function getRecord(uint256 recordId) public view returns (
        address writer,
        uint16 avg,
        uint16 min,
        uint16 max,
        uint16 sessionCount,
        uint256 totDuration,
        string memory main,
        string memory date
    ) {
        require(recordId < records.length, "Record does not exist.");
        Record storage record = records[recordId];
        return (
            record.writer,
            record.avg,
            record.min,
            record.max,
            record.sessionCount,
            record.totDuration,
            record.main,
            record.date
        );
    }

    function getSession(uint16 _id, string memory _date) public view returns (
        uint16 avg,
        uint16 min,
        uint16 max,
        uint16 id,
        uint256 duration,
        string memory main,
        string memory startTime,
        string memory endTime,
        string memory tags,
        string memory comment
    ) {
        require(_id < dayToSessions[_date].length, "Session does not exist.");
        Session storage session = dayToSessions[_date][_id];
        return (
            session.avg,
            session.min,
            session.max,
            session.id,
            session.duration,
            session.main,
            session.startTime,
            session.endTime,
            session.tags,
            session.comment
        );
    }
}

